import { Phone } from '@mui/icons-material';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import {
  Avatar,
  Box,
  Breadcrumbs,
  Chip,
  Divider,
  Link,
  List,
  ListItem,
  ListItemText,
  ListSubheader,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography
} from '@mui/material';
import { blueGrey, blue } from '@mui/material/colors';
import { useEffect, useState } from 'react';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';
import * as Styled from './StatusList.styled';

interface IPilot {
  id?: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
}

export const StatusList = () => {
  const [pilots, setPilots] = useState<Array<IPilot>>();
  const { data } = useFetch<Array<IPilot>>({ url: getURI(API.status) });

  useEffect(() => {
    if (data && data.length) {
      setPilots(data);
    }
  }, [data]);

  return (
    <>
      <Box>
        <Box sx={{ padding: '15px' }}>
          <Breadcrumbs aria-label="breadcrumb">
            <Link underline="hover" color="inherit" href="/">
              Dashboard
            </Link>
            <Typography color="text.primary">Pilotos</Typography>
          </Breadcrumbs>
        </Box>
      </Box>
      {pilots && (
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell colSpan={5}>
                  <Typography
                    color="primary"
                    variant="h5"
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center'
                    }}
                  >
                    Pilotos <strong>ativos</strong> para decolagem.
                  </Typography>
                </TableCell>
              </TableRow>
              <TableRow>
                <TableCell><Typography color="primary" variant="h6"><strong>Piloto</strong></Typography></TableCell>
                <TableCell><strong>Decolagem</strong></TableCell>
                <TableCell><strong>Fone</strong></TableCell>
                <TableCell><strong>Contato Emergência</strong></TableCell>
              </TableRow>

            </TableHead>
            <TableBody>
              {pilots.map((pilot) => (
                <TableRow key={pilot.userId}>
                  {/* Piloto */}
                  <TableCell>
                    <div style={{ display: 'flex', alignItems: 'center' }}>
                      <Avatar
                        alt={pilot.firstName}
                        src="/images/avatar/3.jpg"
                        sx={{ width: 32, height: 32, marginRight: 1 }}
                      />
                      <Typography variant="subtitle1" color={blueGrey[700]}>
                        {pilot.firstName} {pilot.lastName}
                      </Typography>
                    </div>
                  </TableCell>

                  {/* Decolagem */}
                  <TableCell>
                    <Chip
                      label={pilot.status}
                      color="primary"
                      size="small"
                      sx={{ fontSize: 12 }}
                    />
                  </TableCell>

                  {/* Fone */}
                  <TableCell>
                    <div style={{ display: 'flex', alignItems: 'center' }}>
                      <Phone sx={{ fontSize: 16, marginRight: 0.5 }} />
                      <Typography variant="subtitle2" color={blueGrey[500]}>
                        {pilot.cellphone}
                      </Typography>
                    </div>
                  </TableCell>

                  {/* Contato Emergência */}
                  <TableCell>
                    {/* Adapte aqui se você tiver esse campo */}
                    <Typography variant="body2" color="text.secondary">
                      Emergência
                      {/* {pilot.emergencyContact || '—'} */}
                    </Typography>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer >
      )}
    </>
  );
};
